// SPDX-License-Identifier: None
// Saved to 0x917A6b6405EF2bb26D40223c20160cAAd3D9c413

pragma solidity >=0.8.9;
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./IMeerkatRouter02.sol";
import "./IMasterChef.sol";
import "./IMeerkatPair.sol";

contract VogonRouter {
   using SafeERC20 for IERC20;

   address payable public owner;
   bool private locked;
   mapping(address => IERC20) private tokenMap;

   uint256 public performanceFee = 500; // 5%
   uint256 public callFee = 75; // 0.75%
   uint256 public withdrawFee = 50; // 0.5%
   uint256 public withdrawFeePeriod = 72 hours;

   address internal constant MEERKAT_ROUTER_ADDRESS = 0x51aBA405De2b25E5506DeA32A6697F450cEB1a17;
   address internal constant MEERKAT_MASTER_ADDRESS = 0xa2B417088D63400d211A4D5EB3C4C5363f834764;
   //address internal constant MEERKAT_ROUTER_CRO_ADDRESS = 0x145677FC4d9b8F19B5D56d1820c48e0443049a30;
   //address internal constant MEERKAT_MASTER_CRO_ADDRESS = 0x6bE34986Fdd1A91e4634eb6b9F8017439b7b5EDc;
   address internal constant MMFP_ADDRESS = 0x22a31bD4cB694433B6de19e0aCC2899E553e9481;
   address internal constant WMATIC_ADDRESS = 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270;
   IMeerkatRouter02 public meerkatRouter;
   IMasterChef public meerkatMaster;
   //IMeerkatRouter02 public meerkatRouterCro;
   //IMasterChef public meerkatMasterCro;

   event TokenAdded(address addr);

   constructor() {
      owner = payable(msg.sender);

      tokenMap[MMFP_ADDRESS] = IERC20(MMFP_ADDRESS);
      tokenMap[MMFP_ADDRESS].approve(payable(address(this)), 2 ** 255);

      meerkatRouter = IMeerkatRouter02(MEERKAT_ROUTER_ADDRESS);
      meerkatMaster = IMasterChef(MEERKAT_MASTER_ADDRESS);
      //meerkatRouterCro = IMeerkatRouter02(MEERKAT_ROUTER_CRO_ADDRESS);
      //meerkatMasterCro = IMasterChef(MEERKAT_MASTER_CRO_ADDRESS);
   }

   error badAddress();
   error notOwner();

   // Used address be valid
   modifier validAddress(address _addr) {
      if(_addr == address(0)){
         revert badAddress();
      }
      _;
   }

   // Owner only function access
   modifier ownerOnly() {
      if(msg.sender != owner){
         revert notOwner();
      }
      _;
   }

   // No contracts please
   modifier notContract() {
      uint256 size;
      address addr = msg.sender;
      assembly {
         size := extcodesize(addr)
      }
      require(size == 0, "Contracts are not allowed");
      require(tx.origin == msg.sender, "Contracts are not allowed");
      _;
   }

   // Prevent a function from being called while it is still executing.
   modifier noReentrancy() {
      require(!locked, "No reentrancy");

      locked = true;
      _;
      locked = false;
   }
   
   modifier checkAllowance(address _addr, uint _amt) {
      require(tokenMap[_addr].allowance(msg.sender, address(this)) >= _amt, "Check yo allowance");
      _;
   }

   receive() external payable {}
   fallback() external payable {}

   //Get the contract balance for the native token
   function getBalance() public view returns (uint) {
      return address(this).balance;
   }

   function addNewToken(address _addr) public ownerOnly noReentrancy validAddress(_addr){
      tokenMap[_addr] = IERC20(_addr);
      tokenMap[_addr].approve(payable(address(this)), 2 ** 255);
      
      emit TokenAdded(_addr);
   }

   // Token zap _from, zapping _amount, LP token zap _to
   function zapInToken(address _from, uint _amount, address _to) external payable noReentrancy notContract {
      require(_amount > 0, "Invalid zap amount");
      // From an ERC20 to an LP token, through specified router, going through base asset if necessary
      IERC20(_from).safeTransferFrom(msg.sender, address(this), _amount);

      uint _fee = (_amount * callFee) / 1000; //Call fee subtracted 0.75%
      IERC20(_from).safeTransferFrom(address(this), owner, _fee);
      // we'll need this approval to add liquidity
      _approveTokenIfNeeded(_from, MEERKAT_ROUTER_ADDRESS);
      _swapTokenToLP(_from, _amount - _fee, _to, msg.sender);
   }

   // Token zap _from, LP token zap _to
   function zapInETH(address _to) external payable noReentrancy notContract {
      require(msg.value > 0, "Invalid zap amount");

      uint _fee = (msg.value * callFee) / 1000; //Call fee subtracted 0.75%
      (bool sent, ) = owner.call{value: _fee}("");
      require(sent, "Failed to send");

      _swapNativeToLP(_to, msg.value - _fee, msg.sender);
   }

   function withdrawFromFarm(uint256 _pid, uint256 _amount) public payable noReentrancy{
      require(_amount > 0, "Withdraw amount zero");
      uint256 prevBalance = tokenMap[MMFP_ADDRESS].balanceOf(address(this));
      (uint256 _staked, ) = meerkatMaster.userInfo(_pid, address(this));
      require(_staked >= _amount, "Insufficient staked amount");
      meerkatMaster.withdraw(_pid, _amount);
      require(tokenMap[MMFP_ADDRESS].balanceOf(address(this)) - prevBalance == _amount, "Error withdrawing");
      _sendToken(msg.sender, _amount);
   }

   function recieveToken(address _addr,  uint256 _amt) public payable noReentrancy validAddress(_addr) checkAllowance(_addr, _amt){
      require(tokenMap[_addr].balanceOf(msg.sender) > _amt, "Insufficient balance");
      bool sent = tokenMap[_addr].transferFrom(msg.sender, payable(address(this)), _amt);
      require(sent, "Failed to send");
   }

   function _sendToken(address _addr,  uint256 _amt) internal validAddress(_addr) checkAllowance(address(this), _amt){
      require(tokenMap[_addr].balanceOf(address(this)) > _amt, "Insufficient balance");
      bool sent = tokenMap[_addr].transferFrom(payable(address(this)), msg.sender, _amt);
      require(sent, "Failed to send");
   }

   function deposit(uint256 _amt) public payable {
      require(msg.value == _amt);
   }

   function toContract(uint256 _amt) public payable noReentrancy{
      require(msg.sender.balance > _amt, "Insufficient balance");
      (bool sent, ) = payable(address(this)).call{value: _amt}("");
      require(sent, "Failed to send");
   }

   function withdraw() public ownerOnly{
      owner.transfer(payable(address(this)).balance);
   }

   function contractWithdrawToken(address _addr) public noReentrancy validAddress(_addr) ownerOnly{
      bool sent = tokenMap[_addr].transferFrom(address(this), owner, tokenMap[_addr].balanceOf(address(this)));
      require(sent, "Failed to send");
   }

   function withdrawAll(address _addr) public ownerOnly{
      owner.transfer(payable(address(this)).balance);
      bool sent = tokenMap[_addr].transferFrom(address(this), owner, tokenMap[_addr].balanceOf(address(this)));
      require(sent, "Failed to send");
   }

   function _approveTokenIfNeeded(address token, address router) private {
      if (IERC20(token).allowance(address(this), router) == 0) {
         IERC20(token).safeApprove(router, type(uint).max);
      }
   }

   function _swapTokenToLP(address _from, uint _amount, address _to, address _recipient) public payable returns (uint) {
      require(_from == IMeerkatPair(_to).token0() || _from == IMeerkatPair(_to).token1(), "Direct zaps only");
        // get pairs for desired lp
        // if so, we're going to sell half of _from for the other token we need
        // figure out which token we need, and approve
        address other = _from == IMeerkatPair(_to).token0() ? IMeerkatPair(_to).token1() : IMeerkatPair(_to).token0();
        _approveTokenIfNeeded(other, MEERKAT_ROUTER_ADDRESS);
        // calculate amount of _from to sell
        uint sellAmount = _amount / 2;
        // execute swap
        uint otherAmount = _swap(_from, sellAmount, other, address(this));
        uint liquidity;
        ( , , liquidity) = meerkatRouter.addLiquidity(_from, other, (_amount - sellAmount), otherAmount, 0, 0, _recipient, block.timestamp);
        return liquidity;
   }

   function _swap(address _from, uint amount, address _to, address recipient) private returns (uint) {
      address[] memory path = new address[](2);
      path[0] = _from;
      path[1] = _to;

      uint[] memory amounts = meerkatRouter.swapExactTokensForTokens(amount, 0, path, recipient, block.timestamp);
      return amounts[amounts.length - 1];
   }

   function _swapNativeToLP(address _LP, uint _amount, address _recipient) private returns (uint) {
      IMeerkatPair pair = IMeerkatPair(_LP);
      address token0 = pair.token0();
      address token1 = pair.token1();
      uint liquidity;
      require(token0 == WMATIC_ADDRESS || token1 == WMATIC_ADDRESS, "Direct zaps only");
      address token = token0 == WMATIC_ADDRESS ? token1 : token0;
      ( , , liquidity) = _swapHalfNativeAndProvide(token, _amount, _recipient);
      return liquidity;
   }

   function _swapHalfNativeAndProvide(address _token, uint _amount, address _recipient) private returns (uint, uint, uint) {
      uint swapValue = _amount / 2;
      uint tokenAmount = _swapNativeForToken(_token, swapValue, address(this));
      _approveTokenIfNeeded(_token, MEERKAT_ROUTER_ADDRESS);
      return meerkatRouter.addLiquidityETH{value : _amount - swapValue}(_token, tokenAmount, 0, 0, _recipient, block.timestamp);
   }

   function _swapNativeForToken(address _token, uint _value, address _recipient) private returns (uint) {
      address[] memory _path = new address[](2);
      _path[0] = WMATIC_ADDRESS;
      _path[1] = _token;

      uint[] memory amounts = meerkatRouter.swapExactETHForTokens{value : _value}(0, _path, _recipient, block.timestamp);
      return amounts[amounts.length - 1];
   }
}
